      var newImageContainer = document.createElement('span');
      newImageContainer.className = "image-container";

      imageHolder.appendChild(newImageContainer);

    function lazyLoad() {
      var lazyImages = document.querySelectorAll("img[data-src]");
      for (var i = 0; i < lazyImages.length; i++) {
        if (lazyImages[i].getBoundingClientRect().top <= window.innerHeight && lazyImages[i].getBoundingClientRect().bottom >= 0 && getComputedStyle(lazyImages[i]).display !== "none") {
          if (lazyImages[i].hasAttribute("data-src")) {
            var filename = lazyImages[i].getAttribute("data-src");
            lazyImages[i].src = filename;
            lazyImages[i].removeAttribute("data-src");
          }
        }
      }

      if (lazyImages.length === 0) {
        document.removeEventListener("scroll", lazyLoad);
        window.removeEventListener("resize", lazyLoad);
        window.removeEventListener("orientationchange", lazyLoad);
      }
    }

    document.addEventListener("scroll", lazyLoad);
    window.addEventListener("resize", lazyLoad);
    window.addEventListener("orientationchange", lazyLoad);

    window.onload = function () {
      lazyLoad();
    };
